$(document).ready(function () {
    
    $('#proyectos').DataTable({
        dom: 'Bfrtip',
        rowReorder: {
            selector: 'td:nth-child(2)'
        },
        responsive: true,
        paging: true,
        autoWidth: true,
        buttons:[ 
			{
				extend:    'excelHtml5',
				text:      '<i class="fas fa-file-excel"> Exel</i> ',
				titleAttr: 'Exportar a Excel',
				className: 'btn btn-success'
			},
			{
				extend:    'pdfHtml5',
				text:      '<i class="fas fa-file-pdf"> PDF</i> ',
				titleAttr: 'Exportar a PDF',
				className: 'btn btn-danger',
                orientation: 'portrait',
                pageSize: 'A4',
                exportOptions: {
                    columns: ':not(:last-child)',
                    search: 'applied',
                    order: 'applied'
                },
                customize: function (doc) {
                    doc.content.splice(0,1);{
                        var logo = 'data:image/jpeg;base64,'};
                    doc.pageMargins = [30 , 90 , 20 , 40 ];
                    doc.defaultStyle.fontSize = 12;
                    doc.styles.tableHeader.fontSize = 11;
                    doc['header']=(function() {
                        return {
                            columns: [
                                {
                                    image: logo,
                                    width: 35
                                },
                                {
                                    alignment: 'left',
                                    italics: true,
                                    text: 'Central de Licuadoras \n Pulido',
                                    fontSize: 10,
                                    margin: [10,0]
                                },
                                {
                                    alignment: 'left',
                                    italics: true,
                                    text: $('title').text(),
                                    fontSize: 20,
                                    margin: [10,30]
                                },
                                {
                                    alignment: 'center',
                                    fontSize: 9,
                                    text: [{ text: date }],   
                                },
                            ],
                            margin: 20
                        }
                    });
                    doc["body"]=(function() {
                        return {
                            columns: [       
                                {
                                    text:'hola mundo',
                                }
                            ]
                        }
                    });
                    doc['footer']=(function(page, pages) {
                        return {
                                columns: [       
                                {
                                    text:'hola mundo',
                                },
                                {
                                    alignment: 'right',
                                    text: ['Pagina ', { text: page.toString() },	' de ',	{ text: pages.toString() }]
                                }
                            ],
                            margin: 20
                        }
                    });
                    var objLayout = {};
                    objLayout['hLineWidth'] = function(i) { return .5; };
                    objLayout['vLineWidth'] = function(i) { return .5; };
                    objLayout['hLineColor'] = function(i) { return '#aaa'; };
                    objLayout['vLineColor'] = function(i) { return '#aaa'; };
                    objLayout['paddingLeft'] = function(i) { return 10; };
                    objLayout['paddingRight'] = function(i) { return 10; };
                    doc.content[0].layout = objLayout;
                }
            },
			{
				extend:    'print',
				text:      '<i class="fa fa-print"> Imprimir</i> ',
				titleAttr: 'Imprimir',
				className: 'btn btn-info'
                
			},
		],	

        "bDestroy": true,
        "language": {

            "lengthMenu": "Mostrar _MENU_ registros por página",
            "zeroRecords": "No se encontro registro",
            "info": "Mostrando página _PAGE_ de _PAGES_",
            "infoEmpty": "No hay registros disponibles",
            "search": "Buscar: ",
            "infoFiltered": "(filtrado de _MAX_ registros totales)",
            "paginate": {
                "next": "Siguiente",
                "previous": "Anterior"
            }
        }
    });
});